import React, { useState } from 'react';

const App = ()=>{
    let newTime= new Date().toLocaleTimeString();
    
    const [ctime, setCtime] = useState(newTime);

    const UpdateTime = ()=>{
        newCTime= new Date().toLocaleTimeString();

    setCtime(newCTime)
    }

    return(
        <>
            <h1>{ctime}</h1>
            <button onClick={UpdateTime}>GET TIME</button>
        </>
    )
}

export default App;
